This life insurance policy allows flexible premium payments for life. The death benefit is adjustable and ultimately depends on the policy value in the policy. The policy value is based on the amount and timing of your premium payments, monthly deductions, and monthly interest credited to the policy. Interest rates and cost factors are subject to change. The interest rate is guaranteed to never go below \cf1 ##15##\cf0  and costs are guaranteed to not exceed the maximums listed in the policy.\par
